import time


def fuse(l,l_):
    res = []
    temp=[]
    first = l
    second = l_
    i = 0
    begin = time.time()
    while first != []:
        for item in first :
            for word in item :
                temp.append(word)
            for word2 in second[i]:
                temp.append(word2)
            res.append(temp)
            first.pop(0)
            i+=1
            temp = []
    timescale = time.time() - begin
    return res, timescale

